settings.tooltipFunction:
var vehicleType = dsData[dsIndex]['vehicleType'];
if (typeof vehicleType !== undefined) {
    if (vehicleType == "bus") {
        return '<b>Bus: ${entityName}</b><br/><b>Bus route:</b> ${busRoute}<br/>';
    } else if (vehicleType == "car") {
        return '<b>Car: ${entityName}</b><br/><b>Current destination:</b> ${destination}<br/>';
    }
}

settings.colorFunction:
var status = dsData[dsIndex]['status'];
if (typeof status !== undefined) {
    if (status === "On route") {
        return 'green';
    }
    if (status === "Broken") {
        return 'red';
    }
    if (status === "Refueling") {
        return 'blue';
    }
    if (status === "At the stop") {
        return 'orange';
    }
}
return 'red';

settings.markerImageFunction:
var res = {
    url: images[0],
    size: 55
};
var status = dsData[dsIndex]['status'];
if (typeof status !== undefined) {
    if (status === "On route") {
        res.url = images[0];
    } else if (status === "Broken") {
        res.url = images[2];
    } else if (status === "Refueling") {
        res.url = images[3];
    } else if (status === "At the stop") {
        res.url = images[1];
    }
}

return res;

settings.labelFunction:
var status = dsData[dsIndex]['status'];
var color = '#f16362';
if (typeof status !== undefined) {
    if (status === "On route") {
        color = '#52a352';
    }
    if (status === "Broken") {
        color = '#f16362';
    }
    if (status === "Refueling") {
        color = '#408dde';
    }
    if (status === "At the stop") {
        color = 'orange';
    }
}
return "<div style='position: relative; white-space: nowrap; text-align: center; font-size: 16px; top: 25px;'><span style='margin-left: -500%;'></span><div style='border: solid "+color+"; border-radius: 10px; color: "+color+"; background-color: #fff; padding-left: 5px; padding-right: 5px; padding-top: 3px; padding-bottom: 3px;'>${entityName}<div style='font-size: 10px;'> Status: ${status}</div><div style='font-size: 10px;'> Speed: ${speed:0} MPH</div></div><span style='margin-right: -500%;'></span></div>";

